	public void aumentarTamanioFilaNuevaTablaDetalleFormularioRenta107() throws Exception {		
		Dimension dimensionMinimum=this.jTableDatosDetalleFormularioRenta107.getMinimumSize();
		Dimension dimensionMaximum=this.jTableDatosDetalleFormularioRenta107.getMaximumSize();
		Dimension dimensionPreferred=this.jTableDatosDetalleFormularioRenta107.getPreferredSize();
	
		double iHeightConFilaNueva=dimensionPreferred.getHeight();
		
		iHeightConFilaNueva+=this.jTableDatosDetalleFormularioRenta107.getRowHeight();
		
		dimensionMinimum.setSize(dimensionMinimum.getWidth(),iHeightConFilaNueva);
		dimensionMaximum.setSize(dimensionMaximum.getWidth(),iHeightConFilaNueva);
		dimensionPreferred.setSize(dimensionPreferred.getWidth(),iHeightConFilaNueva);
		
		this.jTableDatosDetalleFormularioRenta107.setMinimumSize(dimensionMinimum);
		this.jTableDatosDetalleFormularioRenta107.setMaximumSize(dimensionMaximum);
		this.jTableDatosDetalleFormularioRenta107.setPreferredSize(dimensionPreferred);	
	}
	
